import React from "react";
import styled from "styled-components";

// IMPORT COMPONENT

import CartIcon from "./CartIcon";

function CartMenuButton(props) {
  return (
    <React.Fragment>
      <CartButtonContainer>
        <button>
          <span>
            <CartIcon />
          </span>
          <span>Cart</span>
          <span></span>
        </button>
      </CartButtonContainer>
    </React.Fragment>
  );
}

export default CartMenuButton;

const CartButtonContainer = styled.div``;
